There is a significant differences between the (excellent) drag and drop feedback provided in Windows for the Tree widget and that which is provided in Linux/GTK.  When we receive drag events over a tree and determine that it is a valid drop location, we do the following:

event.setDetail(DND.DROP_COPY);
event.setFeedback(DND.FEEDBACK_INSERT_AFTER);

... and this produces the feedback we expect.  When the user then drags into an invalid drop location, we do the following: 

event.setDetail(DND.DROP_NONE);
event.setFeedback(DND.FEEDBACK_NONE);

Unfortunately, the last DND feedback remains visible, which makes the user think that he/she is still in a valid drop location.  In addition, Windows and Mac provide a crossed out "can't drop here" mouse cursor and Linux does not.

