The JDBCConnection class which provides the text for the label that is displayed on DSE is not fully initialized when the label text is obtained for DSE. Reason below.

The JDBCConnection class's constructor is as below

       public JDBCConnection(IConnectionProfile profile, Class factoryClass) {
               super(profile, factoryClass);
               open();
       }

If I have a subclass as below
class OracleJDBCConnection extends JDBCConnection{
   String providerName = null;
   public OracleJDBCConnection(){
      super();
      providerName = "Oracle Database";
   }

  @Override
  public String getProviderName(){
      return providerName;
  }
}

The super() flows into open() in superclass which calls getProviderName() along the line; but the subclass havenot populated providerName value yet, which results a NPE. This results the label provider to fail in the contentNavigator context.

The call stack copied from Eclipse is as below
OracleJDBCConnection.getProviderName() line: 50   OracleJDBCConnection(VersionProviderConnection).updateServerVersion(Properties) line: 174   OracleJDBCConnection(VersionProviderConnection).updateVersionCache() line: 86   OracleJDBCConnection(DriverConnectionBase).internalCreateConnection() line: 112   OracleJDBCConnection(DriverConnectionBase).open() line: 53   OracleJDBCConnection(JDBCConnection).<init>(IConnectionProfile, Class) line: 48   OracleJDBCConnection.<init>(IConnectionProfile, Class) line: 20   OracleJDBCConnectionFactory.createConnection(IConnectionProfile) line: 15   ConnectionFactoryProvider.createConnection(IConnectionProfile, String, String) line: 85   ConnectionFactoryProvider.createConnection(IConnectionProfile) line: 69   ConnectionProfile.createConnection(String) line: 304   ConnectionInfoImpl.<init>(IConnectionProfile, Class) line: 622   SQMConnectionFactory(ConnectionFactory).createConnection(IConnectionProfile) line: 36   SQMConnectionFactory.createConnection(IConnectionProfile) line: 45   ConnectionFactoryAdapterProvider.createConnection(IConnectionProfile) line: 79   CreateConnectionJob.run(IProgressMonitor) line: 55   Worker.run() line: 58  
So my suggestion is to move out the open() from JDBCConnection(..).

I looked through our usages of JazzResources.getFont(...) and this is the 99% pattern:

Font font= ...
FontData[] fontData= font.getFontData();
for (int a= 0; a < fontData.length; a++)
    fontData[a].setStyle(style);
FontDescriptor descriptor= FontDescriptor.createFrom(fontData);
Font fontVariant= JazzResources.getFont(fResourceManager, descriptor, font);

So you have a base font (not FontDescriptor!) and need a style or size variation of it.
If something fails, the base font is used. There is no effort required to manage the baseFont because
it is already managed somewhere else.

So a Font getFont(FontDescriptor desc, Font default) makes perfect sense.

For a getColor(...) I partially agree (and in fact JazzResources does *not* provide a convenience method that takes a default color). However, the ResourceManager.createColor() methods are painful to use in comparison to a new Color(...) because they throw an exception. So a getColor() that throws a RuntimeException would be useful.

Hmm. What if we added this:

/**
 * Returns a previously-allocated resource or allocates a new one if none
 * exists yet. The resource will remain allocated for at least the lifetime
 * of this resource manager. The resource will be deallocated automatically
 * by the resource manager. Callers must not dispose the resource
 * directly. Throws a RuntimeException if unable to allocate the resource.
 */
public Object get(DeviceResourceDescriptor descriptor);


..and you'd call it like:

Color myColour = (Color)resourceManager.get(colourDescriptor);
Font myFont = (Font)resourceManager.get(fontDescriptor);
Image myImage = (Image)resourceManager.get(imageDescriptor);

...this is nice because it's symmetric between images, fonts, colours, etc. I'm not really fond of all these resource-type-specific methods, anyway.

Or, in your example:

Font font= ...
FontData[] fontData= font.getFontData();
for (int a= 0; a < fontData.length; a++)
    fontData[a].setStyle(style);
FontDescriptor descriptor= FontDescriptor.createFrom(fontData);
Font fontVariant = (Font)fResource.get(descriptor);

This actually takes less code.

(Note: I'll create a proper RuntimeException subclass - I just used the RuntimeException base class here for clarity).

